}

}
* {

}
body,
html {

}
#content {
  height: 100vh;
  width: 100vw;
  display: flex;
  justify-content: center;
  align-items: center;
  overflow: hidden;
  background: linear-gradient(113deg, #00002c -10.29%, #000873 36.48%);
}
.element {
  position: absolute;
}
.phone {
  transition: all 0.6s;
  opacity: 0;
  z-index: 1;
}
.phone.show {
  z-index: 3;
  opacity: 1;
}
.title {
  transition: all 0.6s;
  opacity: 0;
}
.title.show {
  opacity: 1;
}
.btnImg,
.btnImgSup {
  transition: all 0.3s;
  cursor: pointer;
}
.btnImg:hover,
.btnImgSup:hover {
  transform: scale(0.9);
}
.finger {
  transition: all 0.6s;
  opacity: 0;
}
.finger.show {
  z-index: 4;
  opacity: 1;
}
.decor,
.decor__bottom {
  overflow: hidden;
}
.bottomDecor {
  max-width: 10vw;
}
.btn {
  z-index: 55;
}
@media (min-aspect-ratio: 1/1) {
  .decor__bottom {
    right: 4vw;
    bottom: 2vh;
    animation: moveCoins2 15s infinite;
    z-index: 1;
  }
  .decor__bottom img {
    width: 50vw;
  }
  .decor__coinTop {
    top: 0;
    right: 4vw;
    animation: moveCoins2 10s infinite;

    width: 8vw;

    left: 12vw;
  }
  .right {

    justify-content: center;
    align-items: center;
    position: absolute;
    right: 28vw;
    top: 0;
  }
  .right .logo {
    top: 20vh;
  }
  .right .logo img {
    width: 16vw;
  }
  .right .title {
    top: 40vh;
  }
  .right .title img {
    width: 30vw;
  }
  .right .title-four {
    top: 45vh;
  }

  }
  .right .btn img {
    width: 20vw;
  }
  .right .finger {
    top: 64vh;
    right: 46vw;
  }
  .right .finger.fingerAnim {
    animation: finTup 2s ease-in-out infinite alternate;
  }
  .right .finger img {
    transform: scale(1.2);
    width: 5vw;
  }
  .right .finger.fingerNext {
    transition: all 2s;
    right: 38vw;
    top: 85vh;
  }
  .right .finger.finalFinger {
    right: 28vw;
  }
  .right .finger.finalFinger.final {
    right: 37vw;
  }
}
@media (max-aspect-ratio: 1/1) {
  .decor__bottom {
    right: 0;
    bottom: 5vh;
    animation: moveCoins2 15s 1s infinite;
  }
  .decor__bottom img {
    max-width: 15vh;
  }
  .decor__coinTop {
    animation: moveCoins2 15s 3s infinite;
    top: 0;
    right: -6vw;
  }
  .decor__coinTop img {
    width: 10vh;
  }
  .decor__coinMiddle {
    animation: moveCoins2 15s 2s infinite;

    right: 0;
  }
  .decor__coinMiddle img {
    width: 15vh;
  }
  .decor__coinСenter {
    top: 75vh;
    left: 8vw;
    animation: moveCoins2 10s infinite;
  }
  .decor__coinСenter img {
    width: 10vh;
  }
  .decor__coinBottom {
    animation: moveCoins2 15s infinite;
    top: 50%;
    transform: translateY(-50%);
    left: 0;
  }
  .decor__coinBottom img {
    width: 9vh;
  }
  .decor__cube {
    animation: moveCoins2 15s 2s infinite;
    left: 3vw;
    top: 20vh;
  }
  .decor__cube img {
    width: 9vh;
  }
  .left .phone {
    top: 51%;
    left: 50%;
    transform: translate(-50%, -48%);
  }
  .left .phone .phoneFirstImg,
  .left .phone .phoneSecondImg,
  .left .phone .phoneThirdImg,
  .left .phone .phoneFourImg,
  .left .phone .phoneFiveImg {
    height: 47vh;
  }
  .right__element {
    left: 50%;
    transform: translate(-50%);
    z-index: 2;
  }
  .right .logo {
    top: 2vh;
  }
  .right .logo svg {
    width: 35vh;

    transition: all 2s;

    right: 75vw;

  .right .finger.fingerAnim {
    transition: all 2s;
    animation: finTup2 2s ease-in-out infinite alternate;
  }
  .right .finger.fingerNext {
    transition: all 2s;
    top: 56vh;
    animation: finTup3 2s ease-in-out infinite alternate;
    transform: scale(1);

  .right .finger.finalFinger {

    left: 64vw;

@keyframes moveCoins2 {
  0% {
    transform: translateY(0);
  }
  50% {
    transform: translateY(8vh);
  }
  to {
    transform: translate(0);
  }
}
@keyframes finTup {
  30% {
    transform: rotate(0) scale(1) translate(0);
  }
  90% {
    transform: rotate(-20deg) scale(1) translate(0);
  }
  to {
    transform: rotate(-20deg) scale(0.8) translate(-7vh, -14vh);
  }
}
@keyframes finTup2 {
  30% {
    transform: rotate(0) scale(1) translate(0);
  }
  90% {
    transform: rotate(-20deg) scale(1) translate(0);
  }
  to {
    transform: rotate(-20deg) scale(0.8) translate(-3vh, -5vh);
  }
}
@keyframes finTup3 {
  30% {
    transform: rotate(0) scale(1) translate(0);
  }
  90% {
    transform: rotate(-20deg) scale(1) translate(0);
  }
  to {
    transform: rotate(-20deg) scale(0.8) translateY(-9vh);
  }
}
.logo svg {
  width: 30vw;
}
.phoneFiveImg {
  animation: phone5 5s ease-in-out infinite alternate;
}
@keyframes phone5 {
  0% {

    transform: scale(1);
  }
  50% {
    opacity: 0.6;
    transform: scale(0.9);
  }
  to {
    opacity: 1;
    transform: scale(1);
  }
}
